import React from 'react'


const ToDoCount = () => {
    return (
        <span>1 item left</span>
    );
};

const ToDoFilterCompleted = () => {
    return (
        <li>
            <button>Completed</button>
        </li>
    );
}
const ToDoFilterActive = () => {
    return (
        <li>
            <button>Active</button>
        </li>
    );
}
const ToDoFilterSelected = () => {
    return (
        <li>
            <button>Selected</button>
        </li>
    );
}
const ToDoFilter = ()=>{
    return (
        <ul>
            <ToDoFilterSelected/>
            <ToDoFilterActive/>
            <ToDoFilterCompleted/>
        </ul>
    );
}

const ToDoClear = () => {
    return (
        <button className="clear-completed">Clear completed</button>
    );
}


const ToDoFooter = () => {
    return (
        <footer>
            <ToDoCount/>
            <ToDoFilter/>
            <ToDoClear/>
        </footer>
    );
}


export default ToDoFooter;
